import React from "react";
import api from '../../config/Api';
import axios from 'axios';


const rutaSubir = `${api}/api/upload`

class IsertDatos extends React.Component {
  constructor(props) {
    super(props);
    this.state = { 
      data: '',
      file : null
    }
    this.detenerSummit = this.detenerSummit.bind(this);
  }

  //Cargamos los datos de la tabla.
  componentDidMount(){

  }

  handleFile = (e) => {
    this.setState({
      file: e.target.files[0]
    })
  }

  detenerSummit(event){
    e.preventDefault();
    axios.post(rutaSubir, this.state.file, {
        headers: {
            'Content-Type': 'multipart/form-data',
            Authorization: `token ${secretKey}`
        }
    })
    .then(resp => {
        console.log(resp.status);
    })
  }
  
  render() {
    
    return (
      <div className="form-page">
        <form action={rutaSubir} method="POST" enctype="multipart/form-data">
          <br></br>
          <div className='form-group'>
            <label>Importar Datos</label>
          </div>
          <div className='form-group'>
            <div className = 'custom-file mb-3'>
              <input type="file" name="file" className='custom-file-input' id="inputGroupFile" onChange={e => this.handleFile(e)}/>
              <label class="custom-file-label" for="customFile">Selecionar archivo</label>
            </div>
          </div>
          <div className='form-group'>
            <input type="submit" value="Subir" className = 'btn btn-primary' onClick={this.detenerSummit}/>
          </div>
            
        </form>
      </div>
    );
  }
}

export default IsertDatos;
